import "./App.css";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Login from "./components/authentication/Login";
import Signup from "./components/authentication/Signup";
import Verifycode from "./components/authentication/Verifycode";
import Requestcode from "./components/authentication/Requestcode";
import ForgotPassword from "./components/authentication/ForgotPassword";
import Home from "./Pages/Home";
function App() {
  return (
    <BrowserRouter>
      <Routes>
        {/* <Route path="/login" component={Login} /> */}
        <Route path="/signup" component={Signup} />
        <Route path="/verify" component={Verifycode} />
        <Route path="/requestcode" component={Requestcode} />
        <Route path="/forgotpassword" component={ForgotPassword} />
        <Route path="/" component={Home} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
